import { useRouteMatch, useParams, Link } from 'react-router-dom'

function TrucksPage({ trucks }) {
  const match = useRouteMatch()
  const params = useParams()

  const trucksList = trucks.map(truck => {
    return (
      <li key={truck.id}>
        <h2>Truck #{truck.id}</h2>
        <p><b></b>‣ Truck Identification Number: {truck.id}</p>
        <p><b></b> ‣ Truck Model: {truck.truck_model}</p>
        <p><b></b> ‣ Truck Color: {truck.truck_color}</p>
        <p><b></b> ‣ License Plate: {truck.license_plate}</p>
        <p> ‣ Mileage: {truck.mileage}</p>
        <p> ‣ Vin Number: {truck.vin_number}</p>
      </li>  
    )
  })

  return (
    <div className="display">
      <h1>Trucks:</h1>
      <ul>
        {trucksList}
      </ul>
    </div>
  )
}

export default TrucksPage;
